=====<input.inc>=====
which dialog &>/dev/null
(( $? )); flDialogSupp=$?
ANSWER=''

Input_ () {
 local rc default
 [[ $1 == '-d' ]] && {
  shift
  default="$1"
  shift
 }
 if (( flDialogSupp )); then
  local stderr=$(mktemp /tmp/XXXXXXXXXX)
  dialog --nocancel --clear --inputbox "$@" 0 0 "$default" 2>$stderr
  rc=$?   
  (( rc )) || ANSWER=$(<$stderr)
  rm -f "$stderr"
  clear
 else 
  echo -ne "$@${default:+, default value is '$default'} (press ENTER after input): "
  read ANSWER
  rc=$?
 fi
 return $rc
}

YesNo_ () {
 local a
 if (( flDialogSupp )); then
  dialog --yesno "$@" 0 0; a=$?
  clear
  return $a
 else
  a=''
  until [[ $a == 'y' || $a == 'n' ]]; do
   echo -ne "$@ [yn]> "
   read -N1 a
   a=${a,,}
   echo
  done
  [[ $a == 'y' ]] && return 0
  return 1
 fi
}
