declare -a Files2Clean

rmonexit () {
 [[ $@ ]] || return 1
 while [[ $@ ]]; do  
  [[ -f $1 || -d $1 ]] && Files2Clean+=($1)
  shift
 done
 return 0
}

doCleaning () {
 local i f
 if (( ${#Files2Clean[@]} )); then
  for ((i=0; i<${#Files2Clean[@]}; i++)); do
   f="${Files2Clean[$i]}"
   { [[ -f $f ]] && rm -f "$f"; } || \
    { [[ -d $f ]] && rm -rf "$f"; }
  done
 fi
 return 0
}
